ClearCollect(
    colGLAccountSearchResults,
    ReadGLAccountList.Run(
        Substitute(//Remove any null values from the JSON function and convert to empty strings
            JSON(
                {
                    Account: Trim(txtGLAccountSearchName.Text),
                    Description: Trim(txtGLAccountSearchDescription.Text),
                    Chart: cmbGLAccountSearchChartOfAccounts.Selected.'Value Code'
                },
                JSONFormat.IndentFour
            ),
            "null",
            """"""
        )
    )
);
//Evaluate return statuses to determine what type of notification
With(
    {
        Text: Switch(
            First(colGLAccountSearchResults).Status,
            "Information",
            "No general ledger accounts found based upon your search criteria",
            "Warning",
            "The maximum number of search results were found based upon your criteria and some records may be missing. Please try changing your search criteria.",
            "Error",
            Concat(
                First(colGLAccountSearchResults).Messages,
                Message,
                " "
            ),
            "general ledger accounts found based upon your search criteria"
        ),
        Status: First(colGLAccountSearchResults).Status
    },
    Notify(
        //Append record count to message if success
        Concatenate(
            If(
                Status = "Success",
                CountRows(First(colGLAccountSearchResults).List)
            ) & " ",
            If(
        // If the localized text is blank, return the default text
                IsBlank(
                    LookUp(
                        colUserLocalizedStrings,
                        'English Value' = Text
                    ).'Localized Value'
                ),
                Text,
        // If a localized text is found, return that instead of the default text
                LookUp(
                    colUserLocalizedStrings,
                    'English Value' = Text
                ).'Localized Value'
            )
        ),
            //Set the notification type
        Switch(
            Status,
            "Information",
            NotificationType.Information,
            "Warning",
            NotificationType.Warning,
            "Error",
            NotificationType.Error,
            NotificationType.Success
        ),
        If(
            Status = "Error",
            0,
            7000
        )
    )
);
